INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('0214b2c8-b23f-4744-81bd-1dfe63a6d096', '93190f0940c7719d633acaa290dedeb4', 0, 'Most vaccines do not have any mercury in them. However, multi-dose flu vaccines and one type of tetanus-diphtheria (Td) vaccine contain a small amount of thimerosal. Thimerosal contains a form of mercury (ethylmercury) that does not cause mercury poisoning and is safe for use in vaccines. Flu and Td vaccines are also available in thimerosal-free versions. Vaccines can help protect against certain diseases by imitating an infection. This helps teach the immune system how to build immunity to fight off a future infection. Different vaccines provide immunity in different ways. Ingredients in specific vaccines The Food and Drug Administration (FDA), which is responsible for making sure vaccines are safe and effective, has information about all approved vaccines.', '[-0.4483203887939453,0.14653779566287994,0.22228199243545532,-0.49960920214653015,-0.20589251816272736,-0.09110374748706818,0.009128297679126263,0.3004753887653351,-0.21736003458499908,0.04814953729510307,0.2971514165401459,0.765227198600769,0.07588434219360352,-0.8900694251060486,-0.5687174797058105,-0.07054029405117035,0.8386377096176147,0.7672725915908813,-0.33100879192352295,-0.043337468057870865,-0.1038670614361763,-0.5680626034736633,-0.6219350695610046,-0.14847645163536072,0.1861293464899063,-0.06827742606401443,-0.20972253382205963,-0.8817752003669739,0.14653143286705017,0.5645386576652527,-0.16746048629283905,0.35612407326698303,0.3432556986808777,0.40031081438064575,-0.48035284876823425,0.4336257576942444,0.17565937340259552,1.2422510385513306,0.5215038657188416,-0.1461774855852127,-0.21155188977718353,0.10199083387851715,0.13009735941886902,-0.4098617732524872,-1.5946279764175415,-0.08728872239589691,0.7695622444152832,-0.5059852600097656,0.7751795053482056,-0.49095848202705383,-0.17881549894809723,0.015487184748